//Header.js
import React, {Component} from 'react';
import wkndLogoDark from '../../media/wknd-logo-dk.png';

export default class Header extends Component {

    render() {
        return (
                <header className="Header">
                    <div className="Header-container">
                        <h1>WKND</h1>
                    </div>
                </header>
        );
    }
}
